  `product_id` bigint(20) unsigned NOT NULL,
  `sku` varchar(100) NOT NULL,
  `price` decimal(18,2) NOT NULL,
  `discount_price` decimal(18,2) DEFAULT NULL,
  `stock_quantity` int(11) NOT NULL DEFAULT 0,
  `reserved_quantity` int(10) unsigned NOT NULL DEFAULT 0,
  `available_quantity` int(10) unsigned GENERATED ALWAYS AS (`stock_quantity` - `reserved_quantity`) STORED,
  `minimum_stock_level` int(10) unsigned NOT NULL DEFAULT 0,
  `track_inventory` tinyint(1) NOT NULL DEFAULT 1,
  `allow_backorder` tinyint(1) NOT NULL DEFAULT 0,
  `last_restocked_at` timestamp NULL DEFAULT NULL,
  `image_id` bigint(20) unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`variant_id`),
  UNIQUE KEY `product_variants_sku_unique` (`sku`),
  KEY `product_variants_product_id_foreign` (`product_id`),
  KEY `product_variants_image_id_foreign` (`image_id`),
  KEY `product_variants_available_quantity_created_at_index` (`available_quantity`,`created_at`),
  KEY `product_variants_minimum_stock_level_available_quantity_index` (`minimum_stock_level`,`available_quantity`),
  KEY `product_variants_track_inventory_index` (`track_inventory`),
  CONSTRAINT `product_variants_image_id_foreign` FOREIGN KEY (`image_id`) REFERENCES `product_images` (`image_id`) ON DELETE SET NULL,
  CONSTRAINT `product_variants_product_id_foreign` FOREIGN KEY (`product_id`) REFERENCES `products` (`product_id`) ON DELETE CASCADE
