INSERT INTO `products` VALUES (1,NULL,'{\"en\":\"quisquam voluptatibus\",\"vi\":\"Áo khoác sang trọng\"}','{\"en\":\"Cumque perferendis aut provident nihil sit. Voluptates quis molestiae quaerat ducimus distinctio vel.\",\"vi\":\"Thiết kế độc đáo, màu sắc đa dạng, phù hợp với xu hướng thời trang.\"}',9,20,19,'draft',1,'2025-10-18 07:29:38','2025-10-18 07:29:38',NULL),(2,NULL,'{\"en\":\"voluptate perspiciatis\",\"vi\":\"Điện thoại cao cấp\"}','{\"en\":\"Error eaque fugit est et facere. Et qui praesentium consequatur officia eos temporibus quia. Odit qui ut suscipit autem maxime. Sit et temporibus sint nemo quis aperiam qui expedita.\",\"vi\":\"Phù hợp cho mọi lứa tuổi, mang lại sự thoải mái và phong cách.\"}',16,3,10,'draft',1,'2025-10-18 07:29:38','2025-10-18 07:29:38',NULL),(3,NULL,'{\"en\":\"autem ipsa\",\"vi\":\"Túi xách chất lượng\"}','{\"en\":\"Illo consequuntur libero non consequatur autem officiis voluptatibus. Nostrum dolores et vero est saepe quibusdam nostrum. Voluptas hic deleniti aut deserunt porro sed id. Delectus nulla facere non.\",\"vi\":\"Thiết kế độc đáo, màu sắc đa dạng, phù hợp với xu hướng thời trang.\"}',12,21,11,'pending_approval',1,'2025-10-18 07:29:38','2025-10-18 07:29:38',NULL),(4,NULL,'{\"en\":\"molestiae assumenda\",\"vi\":\"Ví da chất lượng\"}','{\"en\":\"Repellendus et cupiditate velit. Aperiam magnam rerum porro ea voluptatem nemo. Consequuntur odio sit accusantium quia nobis culpa. Mollitia non dolores porro eaque ea ut est velit.\",\"vi\":\"Thiết kế độc đáo, màu sắc đa dạng, phù hợp với xu hướng thời trang.\"}',24,16,12,'pending_approval',1,'2025-10-18 07:29:38','2025-10-18 07:29:38',NULL),(5,NULL,'{\"en\":\"nobis culpa\",\"vi\":\"Áo sơ mi hiện đại\"}','{\"en\":\"Et sequi quia repellendus aut. Sed ut magnam aliquid et impedit in dignissimos vel. Ducimus recusandae aut quis aperiam.\",\"vi\":\"Thiết kế độc đáo, màu sắc đa dạng, phù hợp với xu hướng thời trang.\"}',3,7,5,'pending_approval',1,'2025-10-18 07:29:38','2025-10-18 07:29:38'